import './HomePage.css';
import Carousel from '../../components/Carousel/Carousel.js'
import Category from '../../components/Category/Category.js';

/* -- Images -- */
import Banner1 from '../../resources/images/banner2.jpg' 
import Banner2 from '../../resources/images/banner3.jpg'
import Banner3 from '../../resources/images/wide-angle-lens_P4b_690x450.png'
import Category1 from '../../resources/images/top-categ1.jpg';
import Category2 from '../../resources/images/top-categ2.jpg'
import Category3 from '../../resources/images/top-categ3.jpg'
import Category4 from '../../resources/images/top-categ4.jpg'
function HomePage() {

  const carouselImages = [Banner1 , Banner2];
  const categoryNames = ['Upcoming', '7 Day Auction', '24hr Auction', '30 Day Auction'];
  const categoryImages = [Category1, Category2, Category3, Category4];
  const categoryLinks = ['https://www.google.com'];


  return (
    <>
        <div className='homepage'>
          <div className='homepage-carousel'>
            <Carousel imageSrc={carouselImages} />
          </div>
          <div className='homepage-categories'>
              <Category 
                imageSrc={categoryImages[0]}
                categoryName={categoryNames[0]}
                categoryLink={categoryLinks[0]}
              />
              <Category 
                imageSrc={categoryImages[1]}
                categoryName={categoryNames[1]}
                categoryLink={categoryLinks[0]}
              />
              <Category 
                imageSrc={categoryImages[2]}
                categoryName={categoryNames[2]}
                categoryLink={categoryLinks[0]}
              />
              <Category 
                imageSrc={categoryImages[3]}
                categoryName={categoryNames[3]}
                categoryLink={categoryLinks[0]}
              />
          </div>
        </div>

    </>


  );
}

export default HomePage;
